import "../../css/social.css";
import { ExternalLink } from "react-external-link";
import instagram from "../../images/icons/instagram.png";
import spotify from "../../images/icons/spotify.png";

const Social = () => {
  return (
    <div className="command">
      <h3>Social</h3>
      <div className="socialContainer">
        <ExternalLink href="https://github.com/Greenaustin2">
          <i class="devicon-github-original skillIcon"></i>
        </ExternalLink>
        <br />
        <ExternalLink href="https://www.linkedin.com/in/austin--green/">
          <i class="devicon-linkedin-plain skillIcon"></i>
        </ExternalLink>
        <br />
        <ExternalLink href="https://www.instagram.com/a____green/">
          <img src={instagram} alt="instagram logo" className="skillImage" />
        </ExternalLink>
        <br />
        <ExternalLink href="https://open.spotify.com/user/1248693798?si=32a17289121f4d22">
          <img src={spotify} alt="spotify logo" className="skillImage" />
        </ExternalLink>
      </div>
    </div>
  );
};

export default Social;
